nodes.docstring:
Parses the action from the output of the API call.
We assume that model output is a JSON object with the following fields:
{
    "thought": "discussion text here.",
    "command": {
        "arguments": {
            "arg1": "value1",
            "arg2": "value2",
            ...
        },
        "name": "command_name"
    }
}
